import Item from "../../atoms/menuItem/menuItem";
const menu = (props) => {
    return (
        <div className="menu">
            <ul>
                <li>
                    {props.data.navBar.menuItem.map((item, index) => {
                        return <Item text={item} />;
                    })}
                </li>
            </ul>
        </div>
    );
};
export default menu;
